  [],\n\t\"revision_timestamp\": \"2016-07-27T22:25:00.724151\",\n\t\"name\": \"the-effects-of-federal-programs-on-wetlands-in-nevada\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Federal programs have significantly affected
  the quality and quantity of wetlands in Nevada. These affects are due to the large
  proportion of Nevada that is administered by Federal land management agencies (87%)
  and the importance of water development projects in arid river basins with terminal
  wetlands. Reclamation projects have substantially decreased the size of some wetlands,
  completely eliminated others, and benefited none. This report analyzes the extent
  of the problems and offers recommendations on improving wetland areas.\",\n\t\"license_title\":
